          WCARD(0/72) := WCARD and PBUF;  |-- BLANK FILL --|
          if TM(#40,OVER); ON then  |-- UNDERLINE --|
          begin  PBUF := "_";  PBUF(1/71) := PBUF;
          end else PBUF(0/72) := CBUF;
          PBUF(0/72) := PBUF and OBUF;  |-- OVERPRNT --|
