$END M
$IFT M M
    IDRDATA(21/16) := B1;
$END M
$END
    HEADER(94/16) := B1;
$IFT M M
    LISTFLAG(0/1) := B1(16); TESTFLAG(0/1) := B1(17);
    XREF(0/1) := B1(18); TRACE(0/1) := B1(19);
    OVER(0/1) := B1(21);
