       WBUF(4) := "`0`0`0`0`1`0";
       CVD(R1,CONWORK); ED(6,WBUF(3),CONWORK(4)); PRINT;
$IFT M M
       R1 := @WBUFF;  SERCOMPR;
$END M
X:     R0 := 16;
    end else R0 := R0-R0;
    SYSTERM(R9);  |-- RELEASE SYSTEM RESOURCES --|
    if = then R0 := R0+8S;  |-- => NOLOADSW=X'00' --|
    R2 := MEM(R13+4); MEM(R2+16) := R0;  |-- SET RETURN CODE --|
 end.

