GLOBAL PROCEDURE BCDTOVAL(R14);
BEGIN  COMMENT
          R1  POINTS TO THE BCD REPRESENTATION
          R2  INDICATES TYPE:
            1 = INTEGER
            2 = REAL
            3 = LONG REAL
            4 = COMPLEX
            5 = LONG COMPLEX

          RESULTING VALUE IS LEFT IN EITHER R0, F0, F01, F0 AND F2,
          OR F01 AND F23, DEPENDING ON TYPE.  A RETURN CODE IS LEFT
          IN R15:

            0 => SUCCESSFUL SCAN
            1 => INVALID CHARACTER IN INPUT STRING
            2 => MISSING "I" ON IMAGINARY PART
            3 => NONBLANK DELIMITER
            4 => NUMBER SCANNED IS NOT ASSIGNMENT COMPATIBLE
            5 => INTEGER TOO LARGE

          UPON EXIT, R1 IS POINTING AT THE DELIMITER.
        ;

      STM(R14,R12,B13(12)); R14 := R13;
   BEGIN
      SEGMENT BASE R13; ARRAY 18 INTEGER SAVEA; CLOSE BASE;
      B13(4) := R14; B14(8) := R13; COMMENT COMPLETE STANDARD LINKAGE;
   END;

   BEGIN
       FUNCTION REDUCE(6,#0600); COMMENT USE BCTR TO DECREMENT;
      GLOBAL DATA NUMEDTR BASE R14;
       ARRAY  7 LONG REAL POWER10 =
        (#41A0000000000000L,  #4264000000000000L,  #4427100000000000L,
         #475F5E1000000000L,  #4E2386F26FC10000L,  #5B4EE2D6D415B85BL,
         #76184F03E93FF9F5L);
       ARRAY 10 LONG REAL WORKAREA;
          LONG REAL REALPART SYN WORKAREA(0);
            ARRAY 2 INTEGER INTPART SYN REALPART;
       LONG REAL FDCONV = #4200000000000000L;
       ARRAY 256 CHARACTER BLANK = 256(" ");
      CLOSE BASE;
       PROCEDURE NEXTCHAR(R6);
       BEGIN  R5 := @B5(1);  IC(R0,B5);
       END;
       SEGMENT BASE R12;
             INTEGER SCALE; BYTE SIGN, EXPOSIGN, IMAGFLAG, TYPEFLAG, RC;
             INTEGER TYPE;  R5 := R1; MVI(0,RC);
             TYPE := R2; RESET(IMAGFLAG);  F01 := F01-F01;
             REALPART := F01;  R0 := R0 - R0; IC(R0,B5);
             WHILE R0 = " " DO NEXTCHAR;
 NUMBER:     RESET(SIGN);  MVI(1,TYPEFLAG);
             IF R0 = "+" THEN NEXTCHAR ELSE
             IF R0 = "-" THEN BEGIN  SET(SIGN);  NEXTCHAR;
                              END;
             IF R0 = "'" THEN F01 := 1L ELSE F01 := 0L;  R2 := R2-R2;
             WHILE R0 >= "0" DO
             BEGIN  R0 := R0 AND #F;  STC(R0,FDCONV(1));
                F01 := F01*POWER10 + FDCONV;  NEXTCHAR;
             END;
             IF R0 = "." THEN
             BEGIN  MVI(3,TYPEFLAG);  NEXTCHAR;
                WHILE R0 >= "0" DO
                BEGIN  R0 := R0 AND #F;  STC(R0,FDCONV(1));
                   F01 := F01*POWER10 + FDCONV;  REDUCE(R2);  NEXTCHAR;
                END;
             END;
             IF R0 = "'" THEN
             BEGIN  SCALE := R2;  R2 := 0;  MVI(3,TYPEFLAG);
                RESET(EXPOSIGN);  NEXTCHAR;
                IF R0 = "+" THEN NEXTCHAR ELSE
                IF R0 = "-" THEN BEGIN  SET(EXPOSIGN);  NEXTCHAR;
                                 END;
                IF R0 < "0" THEN
                BEGIN  MVI(1, RC); GOTO XIT;
                END;
                WHILE R0 >= "0" DO
                BEGIN  R0 := R0 AND #F;  R2 := R2*10S + R0;  NEXTCHAR;
                END;
                IF EXPOSIGN THEN R2 := NEG R2;  R2 := R2 + SCALE;
             END;
             IF R2 ¬= 0 THEN
             BEGIN  IF < THEN SET(EXPOSIGN) ELSE RESET(EXPOSIGN);
                R2 := ABS R2;  F23 := 1L;  R4 := 0;
                WHILE R2 ¬= 0 DO
                BEGIN  SRDL(R2,1);  LTR(R3,R3);
                   IF < THEN F23 := F23*POWER10(R4);  R4 := R4 + 8;
                END;
                IF EXPOSIGN THEN F01 := F01/F23 ELSE F01 := F01*F23;
             END;
             IF IMAGFLAG AND R0 ¬= "I" THEN
             BEGIN  MVI(2, RC);  GOTO XIT;
             END ELSE
             IF R0 = "I" THEN
             BEGIN  MVI(5,TYPEFLAG);
                NEXTCHAR;  IF R0 = "L" THEN NEXTCHAR;
             END ELSE
             BEGIN
                IF R0 = "L" THEN BEGIN MVI(3,TYPEFLAG);  NEXTCHAR;
                                 END;
                IF R0 = "+" OR R0 = "-" THEN
                BEGIN  SET(IMAGFLAG);  IF SIGN THEN F01 := NEG F01;
                   REALPART := F01;   GOTO NUMBER;
                END;
             END;
             IF R0 ¬= " " THEN
             BEGIN  MVI(3, RC); GOTO XIT;
             END;
             CLI(5,TYPEFLAG);  IF = THEN
             BEGIN  IF SIGN THEN F23 := NEG F01 ELSE F23 := F01;
                F01 := REALPART;
             END ELSE
             IF SIGN THEN F01 := NEG F01;
             R3 := R3-R3;  IC(R3,TYPEFLAG);  R4 := TYPE;
             R0 := R4 OR #1;  IF R0 < R3 THEN
             BEGIN  COMMENT  NOT ASSIGNMENT COMPATIBLE;
                MVI(4, RC);  GOTO XIT;
             END;
             IF R4 = 1 THEN
             BEGIN  F23 := ABS F01 ++ #4E00000000000000L;
                IF F23 > #4E0000007FFFFFFFL THEN
                BEGIN  MVI(5, RC); GOTO XIT;
                END;
                REALPART := F23;  R0 := INTPART(4);
                IF F01 < 0L THEN R0 := NEG R0;
             END ELSE
             IF R4 >= 4S AND R3 < 4S THEN F23 := 0L;
XIT:         R1 := R5;
             R15 := R15 - R15; IC(R15, RC);
   END;      R13 := B13(4); R14 := B13(12); LM(R2,R12,B13(28));
END.


GLOBAL PROCEDURE VALTOBCD(R14);
BEGIN COMMENT

          R1 POINTS TO AREA TO RECEIVE BCD REPRESENTATION
          R2 INDICATES TYPE:
            1 = INTEGER
            2 = REAL
            3 = LONG REAL
            4 = COMPLEX
            5 = LONG COMPLEX

          R3 CONTAINS THE FIELD LENGTH

          THE VALUE TO BE CONVERTED IS IN EITHER R0, F0, F01,
          F0 AND F2, OR F01 AND F23 DEPENDING UPON TYPE.

          RETURN CODE IN R15:

             0 => SUCCESSFUL CONVERSION
             1 => FIELD SIZE TOO SMALL
             2 => INVALID FIELDSIZE
             3 => INVALID TYPE
        ;

         STM(R14,R12,B13(12)); R14 := R13;
   BEGIN
        SEGMENT BASE R13;
           ARRAY 18 LOGICAL SAVEA;
           LONG REAL SAVEF01, SAVEF23;
        CLOSE BASE;
        SAVEF01 := F01;  SAVEF23 := F23;
        B13(4) := R14; B14(8) := R13; COMMENT COMPLETE STANDARD LINKAGE;

   BEGIN
      FUNCTION REDUCE(6,#0600); COMMENT USE BCTR TO DECREMENT;
      EXTERNAL DATA NUMEDTR BASE R14;
       ARRAY  7 LONG REAL POWER10 =
        (#41A0000000000000L,  #4264000000000000L,  #4427100000000000L,
         #475F5E1000000000L,  #4E2386F26FC10000L,  #5B4EE2D6D415B85BL,
         #76184F03E93FF9F5L);
       ARRAY 10 LONG REAL WORKAREA;
       LONG REAL FDCONV = #4200000000000000L;
       ARRAY 256 CHARACTER BLANK = 256(" ");
      CLOSE BASE;
      SEGMENT BASE R12;
       LONG REAL NUM, IMAG;
       ARRAY 23 BYTE STAR="*";
          ARRAY 22 BYTE BCD SYN STAR(1); COMMENT STRING ASSEMBLY AREA;
       ARRAY 12 BYTE INTPATTERN=(" ",9(#20),#21,#20);
       ARRAY 12 BYTE FULLPATTERN=(" ",#21,10(#20));
       BYTE SIGN, LONGFLAG;
       SHORT INTEGER RC;
$PAGE
 PROCEDURE AWXEDITR(R1);
    COMMENT  INPUT:  F0/F01 = VALUE,  R0 = OPTION FLAGS, R2 = FIELDSIZE.
             OUTPUT: R2 = STRING ADDRESS, R3 = LENGTH-1,

          RETURN CODE IN RC:

             1 => FIELD SIZE TOO SMALL
                ;
    BEGIN
       LONG REAL NUM;
         INTEGER NHI SYN NUM;
       ARRAY 2 LOGICAL SAVEREG;
         INTEGER W SYN SAVEREG(4);  COMMENT  FIELDSIZE;
       ARRAY 17 CHARACTER MANTPATTERN=(" ",#21,7(#20),#21,7(#20));
       ARRAY  4 CHARACTER EXPPATTERN=(" ",#21,2(#20));

       STM(R1,R2,SAVEREG);    MVC(21,BCD,BLANK);
       F23 := ABS F01;  IF F2 < #00100000R THEN F01 := F01-F01;
       IF ¬LONGFLAG THEN F0 := F0*1.0;
       RESET(SIGN);  IF F01 ¬= 0L THEN
       BEGIN  IF < THEN SET(SIGN);
          F01 := ABS F01;  NUM := F01;
          R0 := NHI SHRL 24 - 64S * 307S;  IF < THEN R0 := R0 + 255S;
          R0 := R0 SHRA 8 - 1S;   IF R0 < _75S THEN R0 := _75S;
          R2 := ABS R0;  R1 := R1-R1;   F23 := 1L;
          WHILE R2 ¬= 0 DO
          BEGIN  SRDL(R2,1);  LTR(R3,R3);
             IF < THEN F23 := F23*POWER10(R1);  R1 := @B1(8);
          END;
          IF R0 < 0 THEN
          BEGIN  F01 := F01*F23;
             WHILE F01 < 1L DO
             BEGIN  F01 := F01*POWER10;  R0 := R0 - 1S;
             END;
          END ELSE
          BEGIN  F01 := F01/F23;
             WHILE F01 >= POWER10 DO
             BEGIN  F01 := F01/POWER10;  R0 := R0 + 1S;
             END;
          END; F01 := F01 * 1'15L;  R0 := R0 - 15S;
          IF LONGFLAG THEN F01 := F01 ++ #4E00000000000005L ELSE
          F01 := F01 ++ #4E0000001DCD6500L;
          COMMENT ROUND (WITH 5'8L) AND UNNORMALIZE;
          WHILE F01 >= 1'16L DO
          BEGIN  F01 := F01 / POWER10; R0 := R0 + 1S;
             F01 := F01 ++ #4E00000000000000L;
          END;
       END;
       IF F01 = 0L THEN R0 := NEG 15;
       MVC(16,BCD(5),MANTPATTERN);
       NUM := F01; MVI(0,NUM); LM(R2,R3,NUM);
       R3 := R3/100000000; CVD(R2,NUM); ED(7,BCD(14),NUM(3));
       CVD(R3,NUM); ED(9,BCD(5),NUM(3));
       R0 := R0 + 15S;   R2 := W - 3S;
       IF R2 < 3S THEN GOTO FFMT;
       IF R0 >= R2 OR R0 <= _5S THEN
       BEGIN  COMMENT USE E-FORMAT;
          IF SIGN THEN MVI("-",BCD(1)); MVC(0,BCD(2),BCD(7));
          MVI(".",BCD(3)); MVC(13,BCD(4),BCD(8));
          R2 := @BCD(R2); MVC(3,B2,EXPPATTERN);
          CVD(R0,NUM); ED(3,B2,NUM(6)); MVI("'",B2);
          IF R0 < 0 THEN MVI("-",B2(1)) ELSE MVI("+",B2(1));
          R2 := @BCD(1); GOTO XIT;
       END;
 FFMT: IF R0 >= 0 THEN
       BEGIN  COMMENT USE F-FORMAT;
          IF R2 < R0 THEN
          BEGIN  MVC(21,BCD,STAR); R2 := 1; RC := R2;
             R2 := @STAR; GOTO XIT;
          END;
          IF SIGN THEN MVI("-",BCD(5)); R2 := R0;
          EX(R2,MVC(0,BCD(6),BCD(7))); R2 := @BCD(R2+7);
          MVI(".",B2);  R2 := @BCD(5);
       END ELSE
       BEGIN  COMMENT USE F-FORMAT, LEADING ZEROS;
          R2 := R2 + 1S; IF R2 < R0 OR R0 <= _5S THEN
          BEGIN  MVC(21,BCD,STAR); R2 := 1; RC := R2;
             R2 := @STAR; GOTO XIT;
          END;
          R2 := R0; R2 := @BCD(R2+5);
          IF SIGN THEN MVI("-",B2(0)); OC(4,B2(1),"0.000");
       END;
XIT:
       R3 := W - 1S;  R1 := SAVEREG;
    END;

    PROCEDURE COMPLEX (R7);  BEGIN
          IMAG := F23;  REDUCE(R5);  R2 := R5;  R5 := R5 AND _2;
          IF R2 ¬= R5 THEN R4 := @B4(1);  R5 := R5 SHRA 1;
          IF R5 <= 2S THEN COMMENT -- TOO SMALL --;
          BEGIN R2 := 2;  RC := R2;  GOTO XIT;
          END;  IF R5 > 17S THEN COMMENT -- TOO LARGE --;
          BEGIN R5 := R5 - 17S;  R4 := R4 + R5 + R5;  R5 := 17;
          END;  R2 := R5;  AWXEDITR;
          EX(R3,MVC(0,B4,B2));  F01 := IMAG;
          R4 := R4 + R5;  R2 := R5;  AWXEDITR;
          EX(R3,MVC(0,B4,B2));  CLI (" ",B4);
          IF = THEN MVI("+",B4);  R4 := R4 + R5;  MVI("I",B4);
    END;

    PROCEDURE FIXFUDGE (R6);  BEGIN
          IF R5 <= 2S THEN COMMENT -- TOO SMALL --;
          BEGIN R2 := 2;  RC := R2;  GOTO XIT;
          END;  IF R5 > 17S THEN COMMENT -- TOO LARGE --;
          BEGIN R5 := R5 - 17S;  R4 := R4 + R5;  R5 := 17;
          END;  R2 := R5;
    END;

       IF R3 <= 0 OR R3 > 132S THEN
       BEGIN R3 := 2; RC := R3; GOTO XIT;
       END;
       R5 := 0; RC := R5;
       R4 := R1; R5 := R3; R3 := R3 - 2S; MVI(" ",B4);
       IF R3 >= 0 THEN EX(R3,MVC(0,B4(1),B4)); COMMENT BLANK OUT FIELD;
       IF R2 > 0 AND R2 <= 5S THEN CASE R2 OF
       BEGIN
          BEGIN  COMMENT TYPE INTEGER;    R3 := R0;
             MVC(11,BCD,INTPATTERN); CVD(R3,NUM);
             R1 := @BCD(11); EDMK(11,BCD,NUM(2));
             R2 := @BCD(12) - R1; IF R3 < 0 THEN
             BEGIN  REDUCE(R1); MVI("-",B1); R2 := R2 + 1S;
             END;
             IF R2 > R5 THEN
             BEGIN  MVC(21,BCD,STAR); R2 := R5;
             END;
             R3 := @BCD(12) - R2;  R4 := R4 + R5 - R2;
             REDUCE(R2); EX(R2,MVC(0,B4,B3));
          END;
          BEGIN  COMMENT TYPE REAL;
             RESET(LONGFLAG); FIXFUDGE; AWXEDITR;
             EX(R3,MVC(0,B4,B2));
          END;
          BEGIN  COMMENT TYPE LONG REAL;
             SET(LONGFLAG);   FIXFUDGE; AWXEDITR;
             EX(R3,MVC(0,B4,B2));
          END;
          BEGIN  COMMENT TYPE COMPLEX;
             RESET(LONGFLAG);  COMPLEX;
          END;
          BEGIN  COMMENT TYPE LONG COMPLEX;
             SET(LONGFLAG);  COMPLEX;
          END;
       END ELSE
       BEGIN R3 := 3; RC := R3;
       END;
XIT:  F01 := SAVEF01;  F23 := SAVEF23;
      R15 := RC; R13 := B13(4); R14 := B13(12); LM(R0,R12,B13(20));
   END;
   END;
END.
GLOBAL PROCEDURE SHELSORT( R14 );
BEGIN
STM( R14, R12, B13(12) );    COMMENT   SAVE REGS IN CALLER'S AREA;
R12 := R13;        COMMENT   HOLD R13 IN R12 TO GET ADDRESSABILITYON 13;
    BEGIN
    COMMENT        AT ENTRY, R0 - R3 MUST BE SET UP AS BELOW:
    REGISTER USE:
         R0 = N         NUMBER OF ITEMS TO SORT
         R1 = INDEX     BASE ADDRESS OF INDEX ARRAY (1ST ITEM)
         R2 = DISP      LOCATION OF 1ST BYTE OF KEY IN REC (>=1)
         R3 = L         # OF BYTES IN KEY (>=1)
         R4 = X         ADDRESS OF KEY(K)
         R5 = J         MIDDLE LOOP INDEX
         R6 = K         INNER LOOP INDEX
         R7 = KM,KP     K+M, K-M  DEPENDING ON WHETHER FORWARD OR BACKUP
         R8 = M         STEP DISTANCE
         R9 = NM        N-M  # OF STEPS TO TAKE IN J
         R10 = 4        J INCREMENT FOR FAST LOOPS
         R11 = XM       ADDRESS OF KEY(K+M)
         R12 = _4            MASK TO DROP RIGHTMOST 2 BITS
    ALL REGISTERS ARE RETURNED AS SET AT ENTRY;

    INTEGER   REGISTER  N SYN R0,      L SYN R3,      DISP SYN R2,
              X SYN R4, J SYN R5, K SYN R6,  KM SYN R7,    M SYN R8,
              NM SYN R9, VAL4 SYN R10;
    INTEGER   REGISTER  XM SYN R11;
    INTEGER   REGISTER  KP SYN KM;     COMMENT   USED IN BACKUP PHASE;
    INTEGER   REGISTER  MASK SYN R12;
    INTEGER   INDEX SYN B1;

    SEGMENT BASE R13;
    ARRAY 18 INTEGER    SAVEAREA;      COMMENT   O/S LINKAGE SAVE AREA;
    CLOSE BASE;

    B13(4) := R12;      COMMENT   SAVE ADDR OF CALLER'S AREA IN MINE ;
    B12(8) := R13;      COMMENT   SAVE ADDR OF MY AREA IN CALLER'S;
    COMMENT   OKAY, R12 NOW FREE, R15 PROG, R14 RETURN, R13 DATA BASES;

    M := N SHRA 1 SHLA 2;    COMMENT   DIV BY 2, SCALE BY 4;
    N := N SHLA 2;           COMMENT   SCALE LOOP LIMIT BY 4;
    DISP := DISP - 1S;       COMMENT   ADJUST FOR ADDRESSING USE;
    L := L - 1S;             COMMENT   ADJUST FOR EXECUTE USE;
    VAL4 := 4;               COMMENT   SET UP CONSTANT FOR LOOP STEP;
    MASK := NEG VAL4;        COMMENT   MASK TO DROP RIGHTMOST 2 BITS;

    J := J-J;      COMMENT   NOW ADJUST ADDR TABLE TO POINT TO KEY;
    IF DISP¬=0 THEN WHILE J < N DO
         BEGIN
         X := INDEX(J) + DISP;    INDEX(J) := X;      J := J + VAL4;
         END;

    WHILE M > 0 DO
         BEGIN
         NM := N - M;        COMMENT   SET UPPER LIMIT ON J-LOOP;
         J := J-J;
         WHILE J < NM DO     COMMENT   COUNT FROM 0 TO 4*(N-1) BY 4;
              BEGIN
              K := J;        KM := K + M;
              XM := INDEX(KM);    COMMENT   XM HAS ADDRESS OF KEY(K+M);
              X := INDEX(K);      COMMENT   X GETS ADDRESS OF KEY(K);
              EX( L, CLC( 0, MEM(XM), MEM(X)));
              IF < THEN
                   BEGIN     COMMENT   KEY(XM) TOO SMALL, BACK IT UP;
                   INDEX(KM) := X;     COMMENT   SAVE ONLY LARGE ITEM;
                   KP := K-M;     COMMENT   SET BACKUP POINTER UNDER K;
                   WHILE >= DO
                        BEGIN
                        X := INDEX(KP);
                        EX( L, CLC( 0, MEM(XM), MEM(X) ) );
                        IF >= THEN GOTO FORWARD;
                        INDEX(K) := X;   K := KP;   KP := KP-M;
                        END;
         FORWARD:  INDEX(K) := XM;     COMMENT   SAVE SMALL LAST;
                   END;
              J := J + VAL4;      COMMENT   BUMP LOOP INDEX BY 4;
              END;
         M := M SHRA 1 AND MASK;  COMMENT   DIV BY 2, KEEP SCALE OF *4;
         END;

    J := J-J;      COMMENT   NOW RESTORE INDEX ADDRESSES;
    IF DISP¬=0 THEN WHILE J < N DO
         BEGIN
         X := INDEX(J) - DISP;    INDEX(J) := X;      J := J + VAL4;
         END;
    END;

R13 := B13(4);     COMMENT   RESTORE ADDR OF CALLER'S SAVE AREA IN R13;
LM( R14, R12, B13(12) );     COMMENT   RESTORE ALL OTHER REGS;
END.
GLOBAL PROCEDURE BISEARCH (R14);   |-- BINARY SEARCH --|
BEGIN  COMMENT -------------------------------------
    AT ENTRY, R0 - R4 MUST BE SET UP AS FOLLOWS:

         R0 = N         NUMBER OF ELEMENTS IN POINTER ARRAY
         R1 = LOW       ADDRESS OF FIRST ELEMENT IN POINTER ARRAY
         R2 = DISP      NUMBER OF THE 1ST BYTE OF KEY FIELD
         R3 = L         NUMBER OF BYTES IN THE KEY FIELD
         R4 = AX        ADDRESS OF ITEM X TO FIND IN THE TABLE
         NOTE:          N, DISP, & L ARE ALL NUMBERS >= 1.

    DURING EXECUTION, REGISTERS SET AS ABOVE ALONG WITH:

         R9 = HIGH      ADDRESS OF LAST ELEMENT IN POINTER ARRAY
         R5 = AS        ADDRESS OF THE KEY TO COMPARE WITH X
         R6 = M         ADDRESS OF POINTER TO RECORD WITH KEY 'AS'
         R7 = 4         CONSTANT USED FOR FAST ADDS IN LOOP
         R8 = _4        MASK TO DROP RIGHTMOST 2 BITS

    AT EXIT, R1 IS ADDRESS OF ELEMENT IN POINTER ARRAY FOR
         THE RECORD WITH KEY THAT MATCHES X  (0 IF NO MATCH).

    THIS ROUTINE --
         DOES NOT MODIFY     REGISTERS R10 - R15, R0
         SAVES & RESTORES    REGISTERS R2 - R9
         RETURNS ANSWER IN   REGISTER  R1
    ;

    FUNCTION REDUCE(6,#0600); COMMENT USE BCTR TO DECREMENT;
    INTEGER REGISTER    N SYN R0,  HIGH SYN R9,  LOW SYN R1,
                        DISP SYN R2,  AX SYN R4,  AS SYN R5,
                        L SYN R3,  M SYN R6,
                        VAL4 SYN R7,  MASK SYN R8;

    STM(R14,R12,B13(12));  |-- SAVE CALLER'S REGISTERS --|
    REDUCE(L);   REDUCE(DISP);
    VAL4 := 4;   MASK := NEG VAL4;
    HIGH := N;   REDUCE(HIGH);
    HIGH := HIGH SHLA 2 + LOW;  |-- SET UP HIGH INDEX BOUND --|
    WHILE LOW <= HIGH DO   |-- SEARCH THE INDEX --|
    BEGIN  M := LOW + HIGH SHRA 1 AND MASK;  |-- HALF POINT --|
       AS := MEM(M) + DISP;   |-- ADDR OF ITEM TO TEST --|
       EX(L,CLC(0,MEM(AX),MEM(AS)));
       IF = THEN GOTO FOUND;   |-- JUMP IF RECORD FOUND --|
       IF > THEN LOW := M + VAL4 ELSE HIGH := M - VAL4;
    END;   |-- FALL THROUGH IF NOT FOUND. --|
    M := M-M;   |-- ZERO OUT THE RETURN ADDRESS --|
FOUND:  |-- WHEN HERE, M HAS ADDR OF MATCH, OR 0 IF NONE --|
    R1 := M;   |-- RETURN THIS IN R1 --|

    LM(R2,R9,B13(28));  |-- RESTORE ONLY REGS THAT CHANGED --|
END.

SHELSORT.text:
GLOBAL PROCEDURE SHELSORT( R14 );
COMMENT
"The source code for this computer program is placed in the public
 domain and may be used by any party without notice to the copyright
 holder, Stanford University. Stanford University provides no
 support of any kind to this computer program.  Further:

 STANFORD MAKES NO REPRESENTATIONS OR WARRANTIES, EXPRESS OR IMPLIED.
 BY WAY OF EXAMPLE, BUT NOT LIMITATION, STANFORD MAKES NO
 REPRESENTATIONS OR WARRANTIES OF MERCHANTABILITY OR FITNESS FOR ANY
 PARTICULAR PURPOSE OR THAT THE USE OF THE SOFTWARE WILL NOT INFRINGE
 ANY PATENTS, COPYRIGHTS, TRADEMARKS, OR OTHER RIGHTS. STANFORD SHALL
 NOT BE LIABLE FOR ANY LIABILITY OR DAMAGES WITH RESPECT TO ANY CLAIM
 BY A USER OF THIS COMPUTER PROGRAM OR ANY DERIVATIVES OF THIS
 COMPUTER PROGRAM."
;
BEGIN
    COMMENT        AT ENTRY, R0 - R3 MUST BE SET UP AS BELOW:
    REGISTER USE:
         R0 = N         NUMBER OF ITEMS TO SORT
         R1 = INDEX     BASE ADDRESS OF INDEX ARRAY (1ST ITEM)
         R2 = DISP      LOCATION OF 1ST BYTE OF KEY IN REC (>=1)
         R3 = L         # OF BYTES IN KEY (>=1)
         R4 = X         ADDRESS OF KEY(K)
         R5 = J         MIDDLE LOOP INDEX
         R6 = K         INNER LOOP INDEX
         R7 = KM,KP     K+M, K-M  DEPENDING ON WHETHER FORWARD OR BACKUP
         R8 = M         STEP DISTANCE
         R9 = NM        N-M  # OF STEPS TO TAKE IN J
         R10 = 4        J INCREMENT FOR FAST LOOPS
         R11 = XM       ADDRESS OF KEY(K+M)
         R12 = _4            MASK TO DROP RIGHTMOST 2 BITS
    ALL REGISTERS ARE RETURNED AS SET AT ENTRY;

    INTEGER   REGISTER  N SYN R0,      L SYN R3,      DISP SYN R2,
              X SYN R4, J SYN R5, K SYN R6,  KM SYN R7,    M SYN R8,
              NM SYN R9, VAL4 SYN R10;
    INTEGER   REGISTER  XM SYN R11;
    INTEGER   REGISTER  KP SYN KM;     COMMENT   USED IN BACKUP PHASE;
    INTEGER   REGISTER  MASK SYN R12;
    INTEGER   INDEX SYN B1;

    COMMENT   R15 PROG, R14 RETURN, R13 SAVE AREA;

    STM(R14,R12,B13(12));    COMMENT   SAVE REGS IN CALLER'S AREA;

    M := N SHRA 1 SHLA 2;    COMMENT   DIV BY 2, SCALE BY 4;
    N := N SHLA 2;           COMMENT   SCALE LOOP LIMIT BY 4;
    DISP := DISP - 1S;       COMMENT   ADJUST FOR ADDRESSING USE;
    L := L - 1S;             COMMENT   ADJUST FOR EXECUTE USE;
    VAL4 := 4;               COMMENT   SET UP CONSTANT FOR LOOP STEP;
    MASK := NEG VAL4;        COMMENT   MASK TO DROP RIGHTMOST 2 BITS;

    J := J-J;      COMMENT   NOW ADJUST ADDR TABLE TO POINT TO KEY;
    IF DISP¬=0 THEN WHILE J < N DO
         BEGIN
         X := INDEX(J) + DISP;   INDEX(J) := X;    J := J + VAL4;
         END;

    WHILE M > 0 DO
         BEGIN
         NM := N - M;        COMMENT   SET UPPER LIMIT ON J-LOOP;
         J := J-J;
         WHILE J < NM DO     COMMENT   COUNT FROM 0 TO 4*(N-1) BY 4;
              BEGIN
              K := J;        KM := K + M;
              XM := INDEX(KM);    COMMENT   XM HAS ADDRESS OF KEY(K+M);
              X := INDEX(K);      COMMENT   X GETS ADDRESS OF KEY(K);
              EX( L, CLC( 0, MEM(XM), MEM(X)));
              IF < THEN
                   BEGIN     COMMENT   KEY(XM) TOO SMALL, BACK IT UP;
                   INDEX(KM) := X;     COMMENT   SAVE ONLY LARGE ITEM;
                   KP := K-M;     COMMENT   SET BACKUP POINTER UNDER K;
                   WHILE >= DO
                        BEGIN
                        X := INDEX(KP);
                        EX( L, CLC( 0, MEM(XM), MEM(X) ) );
                        IF >= THEN GOTO FORWARD;
                        INDEX(K) := X;   K := KP;   KP := KP-M;
                        END;
         FORWARD:  INDEX(K) := XM;     COMMENT   SAVE SMALL LAST;
                   END;
              J := J + VAL4;      COMMENT   BUMP LOOP INDEX BY 4;
              END;
         M := M SHRA 1 AND MASK;  COMMENT   DIV BY 2, KEEP SCALE OF *4;
         END;

    J := J-J;      COMMENT   NOW RESTORE INDEX ADDRESSES;
    IF DISP¬=0 THEN WHILE J < N DO
         BEGIN
         X := INDEX(J) - DISP;    INDEX(J) := X;    J := J + VAL4;
         END;

    LM(R14,R12,B13(12));     COMMENT   RESTORE ALL REGS;
END.

SYNPROC.text:
$XREF
$TITLE        SIMPLE PRECEDENCE SYNTAX PROCESSOR
COMMENT
"The source code for this computer program is placed in the public
 domain and may be used by any party without notice to the copyright
 holder, Stanford University. Stanford University provides no
 support of any kind to this computer program.  Further:

 STANFORD MAKES NO REPRESENTATIONS OR WARRANTIES, EXPRESS OR IMPLIED.
 BY WAY OF EXAMPLE, BUT NOT LIMITATION, STANFORD MAKES NO
 REPRESENTATIONS OR WARRANTIES OF MERCHANTABILITY OR FITNESS FOR ANY
 PARTICULAR PURPOSE OR THAT THE USE OF THE SOFTWARE WILL NOT INFRINGE
 ANY PATENTS, COPYRIGHTS, TRADEMARKS, OR OTHER RIGHTS. STANFORD SHALL
 NOT BE LIABLE FOR ANY LIABILITY OR DAMAGES WITH RESPECT TO ANY CLAIM
 BY A USER OF THIS COMPUTER PROGRAM OR ANY DERIVATIVES OF THIS
 COMPUTER PROGRAM."
;
 BEGIN COMMENT SYNTAX-PROCESSOR;

    COMMENT OPTION CARDS RECOGNIZED BY THE SYNTAX PROCESSOR
          $SYMBOLS CAUSES THE SYMBOLS TO BE READ IN,
          $MATRIX CAUSES THE MATRIX TO BE PRINTED,
          $FUNCTION CAUSES THE FUNCTIONS TO BE COMPUTED,
          $CHECK CAUSES PROD TO BE CHECKED FOR IDENTICAL RIGHT PARTS,
          $LEFT CAUSES THE RELATIONS TO BE PRINTED FOR THE LEFT SYMBOLS,
          $RIGHT CAUSES THE RELATIONS TO BE PRINTED FOR THE RIGHT SYMB,
          $SYMPUNCH CAUSES THE SYMBOLS TO BE PUNCHED,
          $TABLE CAUSES PL360 TABLES TO BE PUNCHED,
          $SET AND $RESET USED TO FLAG IF-TESTED CODE,
          $IFT AND $IFF USED TO INITIATE IF-TESTING,
          $END USED TO TERMINATE IF-TESTING;
    ARRAY 64 BYTE CONDTAB;  BYTE CONDCK SYN CONDTAB(#2A);
    SHORT INTEGER LSS =1, GTR =2, EQL =3;
    SHORT INTEGER SIX =6;
    ARRAY 4 BYTE  RELATION =(" <>=");
    ARRAY 12 BYTE  ERRMESS =("****** LINE ");
    ARRAY 32 BYTE  MESS1 =("NO PRECEDENCE VIOLATION DETECTED");
    ARRAY 19 BYTE  SYMBMESS =("NONTERMINAL SYMBOLS");
    ARRAY 25 BYTE  PATTERN =("LINE ",#20,#21,#20,
       " SAME AS LINE ",#20,#21,#20);
    LOGICAL ONES =#FFFFFFFF;
    BYTE RETCODE=0, CHANGE=0, ERRFLAG=0;
    BYTE EOPROD=0,SYMPUNCHFLAG=0;
    BYTE MATRIXFLAG=0, TABLEFLAG=0, FUNCTIONFLAG=0;
    BYTE SYMBOLFLAG=0, READFLAG=0, EOF=0;
    BYTE RIGHTFLAG=0, LEFTFLAG=0, CHECKFLAG=0;
    SHORT INTEGER P,V;
    SHORT INTEGER M,MM,M2,MM2,MM32,M64,MM12,M12;
    SHORT INTEGER N,N2,N12,NN,N12P2;
    SHORT INTEGER MSTART=0, MCOUNT=51;
    INTEGER U;
    ARRAY  8  INTEGER FMASK=(#40202120,
       "                ",#40202120,#40404020,#21200000);
    LONG REAL LDC;
    INTEGER MASK3 SYN FMASK;
    ARRAY 6 BYTE MASK4 = (#40,#20,#20,#21,#20,#20);
    INTEGER R1SAVE,R2SAVE,R3SAVE,R4SAVE;
    ARRAY  8  BYTE MASK =(#80,#40,#20,#10,#08,#04,#02,#01);
    ARRAY  20  INTEGER CBUF;
    ARRAY 132 BYTE UNDEFMESS=(" UNDEFINED SYMBOL:",114(" "));
    ARRAY 132 BYTE BLANKS=132(" ");
    ARRAY 256 BYTE BUFFER=256(" ");
    ARRAY  80  BYTE PBUF SYN BUFFER;
    ARRAY  9  LOGICAL SAVE;
    ARRAY 256 SHORT INTEGER F, G;
    ARRAY 256 BYTE F1, G1;
    ARRAY  16  BYTE TRTABLE=("0123456789ABCDEF");
    SHORT INTEGER IPNMAX;
    ARRAY 500 BYTE IPN;
    ARRAY 3000 SHORT INTEGER PRTB;
   SEGMENT BASE  R11;
    ARRAY  3072  BYTE SYTB;
    INTEGER LL;
    ARRAY  256  SHORT INTEGER MTB;
    ARRAY 9068 INTEGER WORKSPACE;
       ARRAY 2048 LOGICAL L SYN WORKSPACE, R SYN MEM(R12);
       ARRAY 4097 LOGICAL H SYN MEM(R10);
       ARRAY 36000 BYTE PR SYN WORKSPACE;
       ARRAY 2048  BYTE PRTB1  SYN WORKSPACE;

 PROCEDURE ERROREXIT(R4);
    BEGIN  MVC(132,BUFFER,BLANKS);
       R0 := @BUFFER; WRITE; MVC(22,BUFFER,"INTERNAL TABLE OVERFLOW");
       WRITE;  GOTO EXIT;
    END;

 SEGMENT PROCEDURE  READINPUT(R9);
 BEGIN COMMENT INPUT AND CONSTRUCT PRODUCTION TABLES;
 PROCEDURE READCARD(R10);
    BEGIN COMMENT READ NEXT CARD IMAGE INTO CARD BUFFER;
       IF EOF THEN ERROREXIT;
 L:    R0 := @CBUF; READ; IF ¬= THEN
       BEGIN  SET(EOF);  SET(EOPROD);  END ELSE
       BEGIN  CLI("$",CBUF); IF = THEN
          BEGIN CLC(7,"SYMPUNCH",CBUF(1)); IF = THEN
             BEGIN SET(SYMPUNCHFLAG); GOTO L;
             END; CLC(5,"SYMBOL",CBUF(1)); IF = THEN
             BEGIN SET(SYMBOLFLAG); GOTO L;
             END; CLC(5,"MATRIX",CBUF(1)); IF = THEN
             BEGIN SET(MATRIXFLAG); GOTO L;
             END; CLC(4,"CHECK",CBUF(1)); IF = THEN
             BEGIN SET(CHECKFLAG); GOTO L;
             END; CLC(4,"RIGHT",CBUF(1)); IF = THEN
             BEGIN SET(RIGHTFLAG); GOTO L;
             END; CLC(3,"LEFT",CBUF(1)); IF = THEN
             BEGIN SET(LEFTFLAG); GOTO L;
             END; CLC(6,"FUNCTION",CBUF(1)); IF = THEN
             BEGIN SET(FUNCTIONFLAG); GOTO L;
             END; CLC(4,"TABLE",CBUF(1)); IF = THEN
             BEGIN SET(TABLEFLAG); GOTO L;
             END; CLC(7,"CONTINUE",CBUF(1));  IF = THEN
             BEGIN SET(EOPROD); GOTO X;
             END; CLC(2,"END",CBUF(1));  IF = THEN GOTO L;
             IF CBUF(1) = "IFT" OR CBUF(1) = "IFF" THEN
             BEGIN  NI(#3F,CBUF(5)); R14 := R14-R14;
                IC(R14,CBUF(5)); IC(R14,CONDTAB(R14));
                STC(R14,CONDCK); CLI("F",CBUF(3));
                IF = THEN XI(#FF,CONDCK);
                IF CONDCK THEN GOTO L;
                NI(#3F,CBUF(7)); CONDCK(0/1) := CBUF(7);
            COND: R0 := @CBUF; READ; IF ¬= THEN
                BEGIN  SET(EOF);  SET(EOPROD);  GOTO X;
                END; CLC(3,CBUF,"$END"); IF ¬= THEN GOTO COND;
                NI(#3F,CBUF(5)); CLC(0,CBUF(5),CONDCK);
                IF ¬= THEN GOTO COND;  GOTO L;
             END; IF CBUF(1) = "SET" OR CBUF(1) = "RES" THEN
             BEGIN R14 := R14-R14;  R0 := #FF;
                CLI("R",CBUF(1));  IF = THEN
                BEGIN IC(R14,CBUF(7));  R0 := R0-R0;
                END ELSE IC(R14,CBUF(5));
                R14 := R14 AND #3F;
                STC(R0,CONDTAB(R14)); GOTO L;
             END;
          END;
    X: END;
    END;

 PROCEDURE WRITEPRODUCTION(R10);
    BEGIN COMMENT R9 = PRODUCTION COUNT;
       R9 := R9 + 1; IF R9 > 499 THEN ERROREXIT;
       MVC(3,BUFFER(7),FMASK); MVC(114,BUFFER(11),BLANKS);
       CVD(R9,LDC); ED(3,BUFFER(7),LDC(6));
       CLC(11,CBUF,BLANKS); IF ¬= THEN MVC(2,BUFFER(35),"::=");
       R7 := @CBUF(12); R8 := @BUFFER(39); MVC(11,BUFFER(22),CBUF);
       FOR R0 := 0 STEP 1 UNTIL 4 DO
       BEGIN CLC(11,B7,B8); IF = THEN GOTO B;
          MVC(11,B8,B7); R7 := R7 + 12; R8 := R8 + 11;
          CLI(" ",B8); WHILE = DO
          BEGIN R8 := R8 - 1; CLI(" ",B8);
          END; R8 := R8 + 3;
       END;
 B:    CLC(3,CBUF(72),"NULL");  IF = THEN R7 := 0 ELSE
       BEGIN  R7 := 1 + IPNMAX;  IPNMAX := R7;
          MVC(3,BUFFER(13),FMASK); CVD(R7,LDC); ED(3,BUFFER(13),LDC(6));
       END;
       STC(R7,IPN(R9));    R0 := @BUFFER;  WRITE;
    END;

 SAVE := R9; READCARD; TEST(SYMBOLFLAG); IF = THEN
 BEGIN COMMENT READ SYMBOLS AND PRODUCTIONS;
    R3 := @SYTB; R2 := 0;
    COMMENT READ NONTERMINAL SYMBOLS;
LN: R3 := R3+12; R2 := R2+1; IF R2 > 255 THEN ERROREXIT;
    MVC(11,B3,CBUF); READCARD;
    CLC(1,"$$",CBUF); IF ¬= THEN GOTO LN;
    MM := R2; R2 := R2 SHLL 1; MM2 := R2; R2 := R2 SHLL 4; MM32 := R2;
    R2 := MM;
    COMMENT READ TERMINAL SYMBOLS;
LT: READCARD; CLC(1,"$$",CBUF);
    IF ¬= THEN
    BEGIN R3 := R3+12; R2 := R2+1; IF R2 > 255 THEN ERROREXIT;
       MVC(11,B3,CBUF); GOTO LT;
    END ;
    M := R2; R2 := R2 SHLL 1; M2 := R2; R2 := R2 SHLL 5; M64 := R2;
    R2 := M2 * 6S; M12 := R2;
    COMMENT READ PRODUCTIONS;
    MVC(131,BUFFER,BLANKS);
    R9 := 0; R5 := 12;
LP: READCARD; TEST(EOPROD); IF ¬= THEN
    BEGIN WRITEPRODUCTION; R3 := @CBUF;
       FOR R6 := 0 STEP 1 UNTIL 5 DO
       BEGIN R4 := @SYTB;
          FOR R1 := 0 STEP 2 UNTIL M2 DO
          BEGIN CLC(11,B3,B4); IF = THEN GOTO LF ELSE R4 := R4+12;
          END ;
          MVC(11,UNDEFMESS(20),B3); R0 := @UNDEFMESS;
          WRITE; OI(1,ERRFLAG);
       LF: PRTB(R5) := R1; R5 := R5+2; R3 := R3+12;
       END ;
       GOTO LP;
    END ;
    N := R9; R2 := R9 SHLL 1; N2 := R2; R2 := R2 * SIX; N12 := R2;
    R2 := R2 + 2; N12P2 := R2;
 END ELSE
 BEGIN COMMENT READ PRODUCTIONS AND CONSTRUCT SYMBOL TABLE;
    MVC(71,PR(72),BUFFER); MVC(15,BUFFER,BLANKS);
    MVC(71,BUFFER(16),PR(72));
    R9 := 0; R4 := @PR;
L1: WRITEPRODUCTION; R4 := R4 + 72; MVC(71,B4,CBUF);
    READCARD; TEST(EOPROD); IF ¬= THEN GOTO L1;
    N := R9; R3 := R9 SHLL 1; N2 := R3; R3 := R3 * SIX;
    N12 := R3;  R2 := 2 + R3;  N12P2 := R2;
    R3 := R3 * SIX; R1 := @PR(R3); R2 := @PR(72); R3 := 0;
    FOR R2 := R2 STEP 72 UNTIL R1 DO
    BEGIN FOR R5 := 0 STEP 12 UNTIL R3 DO
       BEGIN R4 := @SYTB(R5); CLC(11,B2,B4); IF = THEN GOTO F;
       END;
       R3 := R3+12; R4 := @SYTB(R3); MVC(11,B4,B2);
       IF R3 > 3072 THEN ERROREXIT;
 F: END;
    MM12 := R3; R2 := 10+N12; N12 := R2; R2 := @PR(72);
    FOR R1 := 12 STEP 2 UNTIL N12 DO
    BEGIN FOR R5 := 0 STEP 12 UNTIL R3 DO
       BEGIN R4 := @SYTB(R5); CLC(11,B2,B4); IF = THEN GOTO F;
       END;
       R3 := R3+12; R5 := R3; R4 := @SYTB(R3); MVC(11,B4,B2);
       IF R3 > 3072 THEN ERROREXIT;
 F:    R4 := 0; R5 := R5/6;
       PRTB(R1) := R5; R2 := R2+12;
    END;
    M12 := R3;
    R0 := 0; R1 := MM12/12; MM := R1; R1 := R1 SHLL 1;
    MM2 := R1; R1 := R1 SHLL 4; MM32 := R1;
    R1 := M12/12; M := R1; R1 := R1 SHLL 1;
    M2 := R1; R1 := R1 SHLL 5; M64 := R1;
    MVI(0,PR); R1 := @PR; R2 := R1 + 36000;
    FOR R1 := R1 STEP 256 UNTIL R2 DO MVC(255,B1(1),B1);
 END;
    PAGE;
    FOR R1 := 12 STEP 12 UNTIL N12 DO
       BEGIN R2 := PRTB(R1); IF R2 = 0 THEN
          BEGIN R2 := R1-12; R3 := PRTB(R2); PRTB(R1) := R3;
          END ;
       END ;
    COMMENT PRINT THE SYMBOLTABLE (IN TWO PARTS) ;
    R4 := 1; R1 := @SYTB(12);
    MVC(131,BUFFER,BLANKS); MVC(18,BUFFER(8),SYMBMESS);
    R0 := @BUFFER; WRITE; MVC(18,BUFFER(8),BLANKS); WRITE;
L2: FOR R2 := 7 STEP 24 UNTIL 103 DO
    BEGIN IF R4 > MM THEN GOTO L3;
       CVD(R4,LDC); R3 := @BUFFER(R2); MVC(3,B3,FMASK);
       ED(3,B3,LDC(6)); MVC(11,B3(7),B1);
       R1 := R1 + 12; R4 := R4 + 1;
    END;
    WRITE; MVC(131,BUFFER,BLANKS); GOTO L2;

L3: WRITE; MVC(131,BUFFER,BLANKS); WRITE;
    MVC(15,BUFFER(8),SYMBMESS(3)); WRITE;
    MVC(15,BUFFER(8),BLANKS); WRITE;
L4: FOR R2 := 7 STEP 24 UNTIL 103 DO
    BEGIN IF R4 > M THEN GOTO L5;
       CVD(R4,LDC); R3 := @BUFFER(R2); MVC(3,B3,FMASK);
       ED(3,B3,LDC(6)); MVC(11,B3(7),B1);
       R1 := R1 + 12; R4 := R4 + 1;
    END;
    WRITE; MVC(131,BUFFER,BLANKS); GOTO L4;

L5: WRITE; R9 := SAVE;

 IF CHECKFLAG THEN
 BEGIN MVC(131,BUFFER,BLANKS); R0 := @BUFFER; WRITE;
    R1 := @PRTB; R6 := R1 + N12;
    FOR R2 := 12 + R1 STEP 12 UNTIL R6 DO
    BEGIN FOR R3 := 12 + R2 STEP 12 UNTIL R6 DO
       BEGIN CLC(9,B2(2),B3(2)); IF = THEN
          BEGIN IF CHECKFLAG THEN
             BEGIN MVC(31,BUFFER,"IDENTICAL RIGHT PART OCCURRENCES");
                WRITE; RESET(CHECKFLAG); MVC(31,BUFFER,BLANKS);
             END;
             R4 := 0; R5 := R2 - R1 / 12; CVD(R5,LDC);
             MVC(24,BUFFER(3),PATTERN); ED(3,BUFFER(7),LDC(6));
             R4 := 0; R5 := R3 - R1 / 12; CVD(R5,LDC);
             ED(3,BUFFER(24),LDC(6)); WRITE; GOTO L;
          END;
       END;
 L: END;
    IF CHECKFLAG THEN
    BEGIN MVC(23,BUFFER,"NO IDENTICAL RIGHT PARTS");
       R0 := @BUFFER; WRITE;
    END;
 END;

 IF SYMPUNCHFLAG THEN
 BEGIN MVC(79,CBUF,BLANKS); MVC(7,CBUF,"$SYMBOLS");
    R0 := @CBUF; PUNCH; R2 := @SYTB(12);
    FOR R1 := 2 STEP 2 UNTIL M2 DO
    BEGIN MVC(11,CBUF,B2); PUNCH; R2 := R2 + 12;
       IF R1 = MM2 OR R1 = M2 THEN
       BEGIN MVC(11,CBUF,"$$          "); PUNCH;
       END;
    END;
 END;

 END ;  COMMENT  END OF READINPUT;
COMMENT  * * * * * *  E X E C U T I O N * * * * *;

    R1 := 0;
LOOP:  RESET(CONDTAB);  MVC(62,CONDTAB(1),CONDTAB);
    IPNMAX := R1;    R12 := @L + 8192;
    FOR R2 := 0 STEP 4 UNTIL 36268 DO  WORKSPACE(R2) := R1;
    MVC(11,SYTB,BLANKS); READINPUT;
    TM(1,ERRFLAG); IF ON THEN GOTO EXIT;
    PAGE;

 BEGIN COMMENT BUILD TABLES OF LEFT- AND RIGHT OCCURRENCES;
     SEGMENT BASE  R10;
    ARRAY  256  SHORT INTEGER C1,C2,BL,BR,S0,SL,SR;

    R0 := 0;
    FOR R1 := 0 STEP 2 UNTIL M2 DO
    BEGIN C1(R1) := R0;  C2(R1) := R0;
    END;
    FOR R1 := 2 STEP 2 UNTIL N2 DO
    BEGIN R2 := R1 * SIX; R0 := PRTB(R2); S0(R1) := R0;
       R2 := R2+2; R0 := PRTB(R2); SL(R1) := R0;
       R2 := R2+8; R0 := PRTB(R2);
       WHILE R0 = 0 DO
       BEGIN R2 := R2-2; R0 := PRTB(R2);
       END ;
       SR(R1) := R0; R0 := 1; BL(R1) := R0; BR(R1) := R0;
       R2 := S0(R1); R0 := 1+C1(R2); C1(R2) := R0; C2(R2) := R0;
    END ;

    R0 := N; NN := R0;
L1: MVI(0,CHANGE);
    FOR R1 := 2 STEP 2 UNTIL N2 DO
    BEGIN R2 := BL(R1); IF R2 > 0 THEN
       BEGIN R2 := S0(R1); R3 := SL(R1);
          R2 := R2 SHLL 4;     COMMENT R2 = "A" ROW INDEX;
          R4 := R3; SRDL(R4,4); R4 := R4+R2;
          R6 := R6-R6; IC(R6,L(R4));
          R5 := R5 SHRL 29;
          R7 := R7-R7; IC(R7,MASK(R5)); R0 := R6 AND R7;
          IF  = THEN BEGIN R6 := R6 OR R7; STC(R6,L(R4));
                           MVI(1,CHANGE);
                     END ;
          IF R3 <= MM2 THEN
          BEGIN R5 := R3 SHLL 4; COMMENT R5 = "B" ROW INDEX;
             R6 := M SHRL 3 + R2;
             FOR R4 := R2 STEP 4 UNTIL R6 DO
             BEGIN R0 := L(R4) XOR ONES AND L(R5);
                IF ¬= THEN
                BEGIN R0 := R0 OR L(R4); L(R4) := R0; MVI(1,CHANGE);
                END ;
                R5 := R5+4;
             END ;
          END ;
          R2 := R2 SHRL 4; R4 := C1(R3);
          IF R4 = 0 THEN
             BEGIN BL(R1) := R4; R0 := C1(R2)-1; C1(R2) := R0;
                R0 := NN-1; NN := R0;
             END ;
       END ;
    END ;
    CLI(1,CHANGE);
    IF = THEN
    BEGIN R0 := NN; IF R0 > 0 THEN GOTO L1;
    END ;

    R0 := N; NN := R0;
L2: MVI(0,CHANGE);
    FOR R1 := 2 STEP 2 UNTIL N2 DO
    BEGIN R2 := BR(R1); IF R2 > 0 THEN
       BEGIN R2 := S0(R1); R3 := SR(R1);
          R2 := R2 SHLL 4;     COMMENT R2 = "A" ROW INDEX;
          R4 := R3; SRDL(R4,4); R4 := R4+R2;
          R6 := R6-R6; IC(R6,R(R4));
          R5 := R5 SHRL 29;
          R7 := R7-R7; IC(R7,MASK(R5)); R0 := R6 AND R7;
          IF  = THEN BEGIN R6 := R6 OR R7; STC(R6,R(R4));
                           MVI(1,CHANGE);
                     END ;
          IF R3 <= MM2 THEN
          BEGIN R5 := R3 SHLL 4; COMMENT R5 = "B" ROW INDEX;
             R6 := M SHRL 3 + R2;
             FOR R4 := R2 STEP 4 UNTIL R6 DO
             BEGIN R0 := R(R4) XOR ONES AND R(R5);
                IF ¬= THEN
                BEGIN R0 := R0 OR R(R4); R(R4) := R0; MVI(1,CHANGE);
                END ;
                R5 := R5+4;
             END ;
          END ;
          R2 := R2 SHRL 4; R4 := C2(R3);
          IF R4 = 0 THEN
             BEGIN BR(R1) := R4; R0 := C2(R2)-1; C2(R2) := R0;
                R0 := NN-1; NN := R0;
             END ;
       END ;
    END ;
    CLI(1,CHANGE);
    IF = THEN
    BEGIN R0 := NN; IF R0 > 0 THEN GOTO L2;
